/// Return whether c has the 'Changes_When_Lowercased' Unicode property.
pub(crate) fn is_changes_when_lowercased(c: char) -> bool {
    CHANGES_WHEN_LOWERCASED
        .binary_search_by(|&cpr| cpr.compare(c as u32))
        .is_ok()
}

