/// Return whether c has the 'Changes_When_Titlecased' Unicode property.
pub(crate) fn is_changes_when_titlecased(c: char) -> bool {
    CHANGES_WHEN_TITLECASED
        .binary_search_by(|&cpr| cpr.compare(c as u32))
        .is_ok()
}

