/// Return whether c has the 'Changes_When_Uppercased' Unicode property.
pub(crate) fn is_changes_when_uppercased(c: char) -> bool {
    CHANGES_WHEN_UPPERCASED
        .binary_search_by(|&cpr| cpr.compare(c as u32))
        .is_ok()
}

