/// Return whether c has the 'Grapheme_Extend' Unicode property.
pub(crate) fn is_grapheme_extend(c: char) -> bool {
    GRAPHEME_EXTEND
        .binary_search_by(|&cpr| cpr.compare(c as u32))
        .is_ok()
}

