/// Return whether c has the 'XID_Continue' Unicode property.
pub(crate) fn is_xid_continue(c: char) -> bool {
    XID_CONTINUE
        .binary_search_by(|&cpr| cpr.compare(c as u32))
        .is_ok()
}

