/// Return whether c has the 'Extended_Pictographic' Unicode property.
pub(crate) fn is_extended_pictographic(c: char) -> bool {
    EXTENDED_PICTOGRAPHIC
        .binary_search_by(|&cpr| cpr.compare(c as u32))
        .is_ok()
}

